  `lastupdatedby` text COLLATE utf8mb4_general_ci,
  `allocatedfitter` varchar(11) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `date1` date DEFAULT NULL,
  `date2` date DEFAULT NULL,
  `daycap` float NOT NULL DEFAULT '7',
  `nooffitters` float NOT NULL DEFAULT '7',
  `broughtfwd` float NOT NULL DEFAULT '0',
  PRIMARY KEY (`jobid`)
