  `OrderUnitSpec` varchar(30) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `PackQty` int DEFAULT NULL,
  `PurchasePrice` float DEFAULT NULL,
  `PricePerUnit` float GENERATED ALWAYS AS ((`PurchasePrice` / `PackQty`)) VIRTUAL,
  `Quantity` int DEFAULT NULL,
  `TotalValue` float GENERATED ALWAYS AS ((`Quantity` * `PricePerUnit`)) VIRTUAL,
  `LastUpdated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `Category` varchar(15) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
